import React from 'react'
import './BuyButtons.css'
import approveTokenGIF from './static/Approve Token Button.gif'
import BuyTicketGIF from './static/Buy Ticket Button.gif'
function BuyButtons(props) {
  return (
    <div className='buttonContainer'>
        <img className='buttons' alt='NO IMG FOUND' onClick={props.approve} src={approveTokenGIF}></img>
        <img id='depositeBtn' className='buttons' alt='NO IMG FOUND' onClick={props.depositeUSDT} src={BuyTicketGIF}></img>
    </div>
  )
}

export default BuyButtons
